		private static String byteToBase64(byte[] aryByte){
			if(aryByte == null)
				return "";
			String strBase64 = "";
			try{
				strBase64 = new Base64().encodeToString(aryByte);
			}catch(Exception e){
				e.printStackTrace();
			}
			return strBase64;
		}
		
		private static void isSaveToDir (String io,String pdfName,String ebankEditPath){
			//创建到指定文件的输出流
			FileOutputStream fout  = null;
			try {
				//byte[] pdf = new BASE64Decoder().decodeBuffer(io);  
				byte[] pdf = new Base64().decodeBase64(io);  
				for (int i = 0; i < pdf.length; ++i) {  
					if (pdf[i] < 0) {  
						// 调整异常数据  
						pdf[i] += 256;  
					}  
				}
				File file = new File(ebankEditPath,pdfName); 
				if (!file.exists()) {  
					file.createNewFile();  
				}
				fout = new FileOutputStream(file);
				fout.write(pdf);  
				fout.flush();  
			} catch (Exception e) {
				e.printStackTrace();
			} finally{
				try {
					if(fout != null){
						fout.close();
					}
				} catch (IOException e) {
					e.printStackTrace();
				}
			}
		}
		
